Text:
@steveriggins @bmike @DanFrakes Well, even Linksys was bought by Belkin.

You have to go by their privacy policy, really. Netgear can sell info if their PP lets them.

Plume does show you rather detailed, per-device info about bandwidth, + aggregated info.

@coolcsh @AmpliFiHome Question for you (or anyone), how any devices connect to yours?
I'm thinking of keeping my old netgear running for my iot things.
I have a lot of wifi connected devices and am now looking at WiZ bulbs which all connect directly too.

@Kelly_Clowers @AmpliFiHome That's kinda interesting. I'm not sure how I feel about it. I switched because my netgear got less and less reliable. Crashing numerous times a week. So I value a more reliable product.
Not sure what I'm prepared to give up for that.
Just anonymous crash reports? Maybe
